  const [good, setGood] = useState(0);
  const [neutral, setNeutral] = useState(0);
  const [bad, setBad] = useState(0);
  const clickIncrement = ({func, param}) => {
    return func(param + 1)
  }

  return (<div>
    <p>This is fullstackopen</p>
    <Button clickIncrement={setGood, good} name={"Good"}/>

  </div>)
}

export default App;
